import Cells from "./Game/Cells/Cells";
import Pieces from "./Game/Pieces/Pieces";
import NextMoves from "./Game/Indicators/NextMoves";
import CheckIndicator from "./Game/Indicators/CheckIndicator";
import EatenPieces from "./Game/Eaten pieces/Eaten pieces";

export default function Game(){


    console.log("render");

    return (
        <EatenPieces>
            <PromotionContext>
                <Cells/>
                <Pieces/>
                <NextMoves/>
                <Notation/>
                <Promotion/>
                <CheckIndicator/>
            </PromotionContext>
            {/* <Button/> */}
        </EatenPieces>
    )

}
